import WhereWeAre from './components/WhereWeAre/WhereWeAre';
import ExRoutes from './components/Routes/ExRoutes';
function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Index />} />
        <Route path="/who-we-are" element={<Index />} />
        <Route path="/who-we-are" element={<Index />} />
        <Route path="/routes" element={<ExRoutes />} />
      </Routes>
    </Router>
  );
}

export default App;
